class JwtClient {
    token = "";

    authenticate(username, password) {
        var body = {
            username: username,
            password: password,
        };

        var myHeaders = new Headers();

        fetch("https://localhost:8443/login", {
            method: "POST",
            headers: myHeaders,
            mode: "cors",
            cache: "default",
            body: body,
        }).then((resp) => {
            console.log(resp.data);
        });
    }
}

export default JwtClient;
